import React from "react";
import card from "./card";

const Cardlist = ({ services }) => {
    return(
        <div>
            {
                services.map((user, i) => {
                    return (
                        <card 
                        key={i} 
                        id={services[i].id} 
                        name={services[i].name} 
                        email={services[i].email}
                        />
                    );
                })
            }
        </div>
    );
}

export default Cardlist;
